import React, { Component } from 'react';

class Navig extends Component {
    render() {
        return (
            <div className='w-full col-span-12 bg-amber-800 h-20 mt-10 px-10'>
                <nav className='grid  h-20 w-8/12 ' > 
                    <div >

                        <img
                        id="logo"
                        src="8mvmt logo.jpg"
                        alt="carbonABLE"
                        className='h-20'
                        />

                    </div>
                </nav>
            </div>
        );
    }
}

export default Navig;
